import React from "react";

function ItemCard({ item }) {
  return (
    <div>
      <spam>{item.discount}</spam>
      <div
        className="item"
        style={{
          width: 128,
          height: 188,
          backgroundImage: `url(${item.img_url})`
        }}
      ></div>
      <div>
        <p>{item.name}</p>
        <p>{item.price}</p>
        <button>Add to cart</button>
      </div>
    </div>
  );
}
export default ItemCard;
